function readShareCode() {
  return new Promise(resolve => {
    $.get({url: `https://raw.githubusercontent.com/hajiuhajiu/jdsign1112/master/backUp/total/jxnc.json`}, (err, resp, data) => {
      try {
        if (err) {
          console.log(`${JSON.stringify(err)}`)
          console.log(`${$.name} API请求失败，请检查网路重试`)
        } else {
          if (data) {
            console.log(`随机取个${randomCount}码Network`)
            const jxncShareCodeArr = JSON.parse(data);
          }
        }
      } catch (e) {
        $.logErr(e, resp)
      } finally {
        resolve(data);
      }
    })
  })
}
function getAssistUser() {
    return new Promise(resolve => {
        try {
            $.get({url: `https://raw.githubusercontent.com/hajiuhajiu/jdsign1112/master/backUp/total/jxnc.json`, timeout: 10000}, async (err, resp, _data) => {
                try {
                    const {code, data: {value, extra = {}} = {}} = JSON.parse(_data);
                    if (value && extra.active) { //  && extra.joinnum 截止 2021-01-22 16:39:09 API 线上还未部署新的 joinnum 参数代码，暂时默认 1 兼容
                        let shareCodeJson = {
                            'smp': value,
                            'active': extra.active,
                            'joinnum': extra.joinnum || 1
                        };
                        $.log(`获取随机助力码成功 ` + JSON.stringify(shareCodeJson));
                        resolve(shareCodeJson);
                        return;
                    } else {
                        $.log(`获取随机助力码失败 ${code}`);
                    }
                } catch (e) {
                    // $.logErr(e, resp);
                    $.log('获取随机助力码失败 API 返回异常');
                } finally {
                    resolve(false);
                }
            });
        } catch (e) {
            // $.logErr(e, resp);
            resolve(false);
        }
    });
}
